script:
reset();

const room = {
  x: -10,
  y: 0,
  z: -24,
};

box(
  room.x - 5, room.y, room.z - 5,
  30, 22, 30,
  2
);
box(
  room.x - 4, room.y + 1, room.z - 4,
  28, 20, 28,
  (x, y, z) => (
  	x < room.x || x > room.x + 19 ? 5 : 1
  )
);
box(
  room.x, room.y + 2, room.z,
  20, 18, 20,
  0
);
sphere(
  room.x + 4,
  room.y + 10,
  room.z + 9,
  8,
  0
);
sphere(
  room.x + 14,
  room.y + 10,
  room.z + 9,
  8,
  0
);
[
  [3, 3],
  [16, 3],
  [3, 16],
  [16, 16],

  [7, 7],
  [12, 7],
  [7, 12],
  [12, 12],
].forEach(([x, z]) => {
  box(room.x + x - 2, room.y + 19, room.z + z - 2, 5, 1, 5, 1);
  box(room.x + x - 1, room.y + 19, room.z + z - 1, 3, 3, 3, 0);
});
box(room.x + 3, room.y + 4, room.z - 9, 14, 14, 10, (x, y, z) => z < room.z ? 4 : 1);
box(room.x + 4, room.y + 5, room.z - 8, 12, 12, 10, 0);
box(room.x + 4, room.y + 5, room.z - 1, 12, 1, 1, 4);
box(room.x + 4, room.y + 16, room.z - 1, 12, 1, 1, 4);
update(
  room.x + 5, room.y + 16, room.z - 6,
  3
);
update(
  room.x + 14, room.y + 16, room.z - 6,
  3
);
update(
  room.x + 5, room.y + 5, room.z - 6,
  3
);
update(
  room.x + 14, room.y + 5, room.z - 6,
  3
);
const elevator = {
  x: -4,
  y: 0,
  z: -4,
};

box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  2
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z - 1,
  4, 5, 1,
  4
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z - 1,
  2, 4, 3,
  0
);
